/** @format */

import React from "react";
import { TextField } from "@mui/material";

const NewMatter = () => {
  const [matterData, setMatterData] = useState({
    contact: "",
    matter_number: "",
    matter_name: "",
    alerts: "",
    matter_type: "",
    matter_source: "",
    matter_status: "",
    assign_to: "",
    billing_rate: "",
    open: "",
    closed: "",
    total_days: "",
    jurisdiction: "",
    status_limitaion: "",
    opposing_counsel: "",
    where: "",
    when: "",
    involved: "",
    witnesses: "",
    narrative: "",
  });

  const {
    contact,
    matter_number,
    matter_name,
    alerts,
    matter_type,
    matter_source,
    matter_status,
    assign_to,
    billing_rate,
    open,
    closed,
    total_days,
    jurisdiction,
    status_limitaion,
    opposing_counsel,
    where,
    when,
    involved,
    witnesses,
    narrative,
  } = matterData;

  const onChange = (e) =>
    setmatterData({ ...matterData, [e.target.name]: e.target.value });
  return (
    <Fragment>
      {matterData.map((matter, index) => {
        <TextField
          margin="normal"
          required
          fullWidth
          variant="standard"
          name={matter}
          label={matter}
          type="text"
          value={matter}
          onChange={(e) => onChange(e)}
          id={matter}
          minLength="6"
          autoComplete={matter}
        />;
      })}
    </Fragment>
  );
};

export default NewMatter;
